import React from "react";
import { Container, Typography } from "@mui/material";

const PrivacyPolicy = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom mt={4}>
        Privacy Policy
      </Typography>
      <Typography paragraph>
        At Landora, we value your privacy. We only collect data necessary to
        provide you with a smooth property management experience.
      </Typography>
      <Typography paragraph>
        Your personal data will never be sold or misused. We adhere to industry
        standards to keep your information safe.
      </Typography>
    </Container>
  );
};

export default PrivacyPolicy;
